import React from 'react';
import ProjectCard from './ProjectCard';
import './Dashboard.css'; // Assuming you want to add some CSS

const Dashboard = () => {
  const projects = [
    {
      title: 'Urban Heat Island Mitigation with Green Roofs',
      image: 'ComboChart.png',  // Replace with actual paths
      graphColor: 'green',
    },
    {
      title: 'Precision Farming for Sustainable Agriculture',
      image: 'ComboChart_1.png',  // Replace with actual paths
      graphColor: 'red',
    },
    {
      title: 'Development of Data Center',
      image: 'ComboChart_2.png',  // Replace with actual paths
      graphColor: 'orange',
    },
  ];

  return (
    <div className="dashboard">
      <h2>Dashboard</h2>
      <button className="create-project-btn">Create a new Project</button>
      <div className="project-grid">
        {projects.map((project, index) => (
          <ProjectCard
            key={index}
            title={project.title}
            image={project.image}
            graphColor={project.graphColor}
          />
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
